(11, '474/*0*/DS.2011/', 'Surat Keterangan KTP Sementara', '<p>&nbsp;</p>\r\n<p style="text-align: left;" align="center">&nbsp;</p>\r\n<p style="text-align: center;" align="center"><strong><span style="font-family: Arial,sans-serif;"><u><span style="font-family: Arial,sans-serif; letter-spacing: .4pt;">KARTU TANDA PENDUDUK (KTP) SEMENTARA</span></u></span></strong><br /><span style="font-family: Arial,sans-serif;">Nomor : *[no_srt]*</span><br /><br /></p>\r\n<p style="text-align: left;" align="center"><span style="text-align: justify; font-family: Arial, sans-serif;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yang bertanda-tangan di bawah ini, Kepala Desa&nbsp;</span><span style="text-align: justify; font-family: Arial, sans-serif;">*[nmdesa]*</span><span style="text-align: justify; font-family: Arial, sans-serif;"> Kecamatan *[nmkec]*&nbsp;Kabupaten *[nmkab]*, menerangkan bahwa.</span></p>\r\n<div align="center">\r\n<table style="border-collapse: collapse;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="width: 111.75pt; padding: 0cm 5.4pt 0cm 5.4pt;" valign="top" width="149">\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">N a m a</span></p>\r\n<p style="line-height: 110%;"><strong><span style="font-family: Arial, sans-serif;">NIK</span></strong></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">Tempat/Tgl. Lahir</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">Jenis Kelamin</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">Agama</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">Pekerjaan</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">Alamat</span></p>\r\n</td>\r\n<td style="width: 14.15pt; padding: 0cm 5.4pt 0cm 5.4pt;" valign="top" width="19">\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">:</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">:</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">:</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">:</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">:</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">:</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">:</span></p>\r\n</td>\r\n<td style="width: 271.35pt; padding: 0cm 5.4pt 0cm 5.4pt;" valign="top" width="362">\r\n<p style="line-height: 110%;"><strong><span style="font-family: Arial, sans-serif;">*[nama]*</span></strong></p>\r\n<p style="line-height: 110%;"><strong><span style="font-family: Arial, sans-serif;">*[nik]*</span></strong></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">*[tmp_lhr]*, &nbsp;*[tgl_lhr]*</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">*[jk]*</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">*[agama]*</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">*[pekerjaan]*</span></p>\r\n<p style="line-height: 110%;"><span style="font-family: Arial, sans-serif;">*[alamat]* &nbsp;RT *[rt]*&nbsp;&nbsp; RW&nbsp; *[rw]*&nbsp;&nbsp; Desa *[nmdesa]* Kecamatan *[nmkec]* Kabupaten *[nmkab]*</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><span style="font-family: Arial, sans-serif;">&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;</span></p>\r\n<p><span style="font-family: Arial,sans-serif;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Adalah salah seorang warga masyarakat kami, telah memohon surat keterangan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</span></p>\r\n<p style="text-align: center;" align="center"><strong><span style="font-family: Arial, sans-serif;">======== KARTU TANDA PENDUDUK (KTP) SEMENTARA ========</span></strong></p>\r\n<p style="text-align: justify;"><span style="font-family: Arial,sans-serif;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Surat</span><span style="font-family: Arial, sans-serif;">&nbsp; keterangan&nbsp; ini, kami berikan&nbsp; kepadanya&nbsp; berdasarkan atas sepengetahuan dan pertimbangan bahwa nama tersebut di atas&nbsp; benar-benar&nbsp; salah seorang warga masyarakat Desa kami yang tinggal secara menjdhfjdfhdjfjd etap di alamat tersebut di atas&nbsp;</span><span style="font-family: Arial, sans-serif;">dan sampai saat ini masih tercatat dalam buku kependudukan sesuai dengan surat keterangan yang diberikan oleh para ketua RT dan RW nya Dan perlu kami sampaikan bahwa KTP yang bersangkutan sedang dalam proses pembuatan.&nbsp;</span><br /><br /><span style="font-family: Arial,sans-serif;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Demikian Surat Keterangan ini dibuat dengan sebenarnya untuk dipergunakan seperlunya dan yang berkepentingan agar menjadi maklum.</span></p>\r\n<table style="margin-left: 27pt; border-collapse: collapse;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="width: 231.05pt; padding: 0cm 5.4pt 0cm 5.4pt;" valign="top" width="308">&nbsp;</td>\r\n<td style="width: 231.05pt; padding: 0cm 5.4pt 0cm 5.4pt;" valign="top" width="308">\r\n<p style="margin-right: 23.8pt; text-align: center;" align="center"><span style="font-family: Arial,sans-serif;">*[nmdesa]*</span><span style="font-family: Arial,sans-serif;">, </span><span style="font-family: Arial,sans-serif;">&nbsp;*[tglsrt]*</span><br /><span style="font-family: Arial,sans-serif;">*[an]*</span><span style="font-family: Arial,sans-serif;">&nbsp;&nbsp; Kepala Desa </span><strong>*[nmdesa]*</strong><br />*[jabatan]*<br /><br /><br /><br /><br /><br /><strong><span style="font-family: Arial,sans-serif;">*[nm_ttd]*</span></strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 0, 1, 1, '1'),
(27, '100/*0*/SK-BM/NKTGG/', 'Surat Keterangan Belum Menikah', '<p><img style="width: 700px; height: 122px;" src="img/logo/KOPS KOTO GADANG.jpg" alt="" /><br /><br /></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: center;" align="center"><br /><span style="font-family: Arial; font-size: 14px;"><strong><u><span style="font-size: 16px;">SURAT KETERANGAN</span></u></strong></span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: center;" align="center"><span style="font-family: Arial; font-size: 14px;">Nomor : *[no_srt]*</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify;"><span style="font-family: Arial; font-size: 14px;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; text-indent: 36pt;"><span style="font-family: Arial; font-size: 14px;">Yang bertanda tangan di bawah ini Kepala Desa *[nmdesa]* Kecamatan *[nmkec]* Kabupaten *[nmkab]*, dengan ini menerangkan bahwa :</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify;"><span style="font-family: Arial; font-size: 14px;">&nbsp;</span></p>\r\n<table class="MsoTableGrid" style="margin-left: 40.85pt; border-collapse: collapse;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="width: 112.9pt; padding: 0cm 5.4pt;" valign="top" width="151">\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify;"><span style="font-family: Arial; font-size: 14px;">Nama</span></p>\r\n</td>\r\n<td style="width: 14.7pt; padding: 0cm 5.4pt;" valign="top" width="20">\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify;"><span style="font-family: Arial; font-size: 14px;">:</span></p>\r\n</td>\r\n<td style="width: 269.85pt; padding: 0cm 5.4pt;" valign="top" width="360">\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify;"><span style="font-family: Arial; font-size: 14px;">*[nama]*</span></p>\