(40, '100/*0*/SK/NKTGG/', 'Surat Keterangan Janda / Duda', '<p>&nbsp;</p>\r\n<p>&nbsp;<img style="height: 122px; width: 700px;" src="img/logo/KOPS KOTO GADANG.jpg" alt="" /><br /> &nbsp;</p>\r\n<p style="text-align: center;"><strong><u><span style="font-size: 14.0pt;">SURAT KETERANGAN</span></u></strong></p>\r\n<p style="text-align: center;">Nomor : *[no_srt]*</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">Yang bertanda tangan di bawah ini Kepala Desa *[nmdesa]* Kecamatan *[nmkec]* Kabupaten *[nmkab]*, dengan ini menerangkan bahwa :</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<table id="tbsurat" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="width: 112.9pt;">\r\n<p style="text-align: justify;">Nama</p>\r\n</td>\r\n<td style="width: 14.7pt;">\r\n<p style="text-align: justify;">:</p>\r\n</td>\r\n<td style="width: 269.85pt;">\r\n<p style="text-align: justify;">*[nama]*</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 112.9pt;">\r\n<p style="text-align: justify;">Tempat/Tgl. Lahir</p>\r\n</td>\r\n<td style="width: 14.7pt;">\r\n<p style="text-align: justify;">:</p>\r\n</td>\r\n<td style="width: 269.85pt;">\r\n<p style="text-align: justify;">*[tmp_lhr]*/*[tgl_lhr]*</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 112.9pt;">\r\n<p style="text-align: justify;">Jenis Kelamin</p>\r\n</td>\r\n<td style="width: 14.7pt;">\r\n<p style="text-align: justify;">:</p>\r\n</td>\r\n<td style="width: 269.85pt;">\r\n<p style="text-align: justify;">*[jk]*</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 112.9pt;">\r\n<p style="text-align: justify;">Status Kawin</p>\r\n</td>\r\n<td style="width: 14.7pt;">\r\n<p style="text-align: justify;">:</p>\r\n</td>\r\n<td style="width: 269.85pt;">\r\n<p style="text-align: justify;">*[status_kawin]*</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 112.9pt;">\r\n<p style="text-align: justify;">Agama</p>\r\n</td>\r\n<td style="width: 14.7pt;">\r\n<p style="text-align: ju