(63, '212/*/ugenks', 'Surat Jual Beli Tanah', '<p style="text-align: center;"><strong><u><span style="font-size: 14.0pt;">S U R A T P E R N Y A T A A N J U A L B ELI</span></u></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Yang bertanda tangan di bawah ini :</p>\r\n<table id="tbsurat" border="0" cellspacing="0">\r\n<tbody>\r\n<tr>\r\n<td style="width: 156.9pt;">\r\n<p>Nama</p>\r\n</td>\r\n<td style="width: 14.15pt;">\r\n<p>:</p>\r\n</td>\r\n<td style="width: 353.05pt;">\r\n<p>*[nama]*</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 156.9pt;">\r\n<p>No. KTP</p>\r\n</td>\r\n<td style="width: 14.15pt;">\r\n<p>:</p>\r\n</td>\r\n<td style="width: 353.05pt;">\r\n<p>*[nik]*</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 156.9pt;">\r\n<p>Tempat Tanggal Lahir</p>\r\n</td>\r\n<td style="width: 14.15pt;">\r\n<p>:</p>\r\n</td>\r\n<td style="width: 353.05pt;">\r\n<p><span style="font-size: 10.5pt;">*[tmp_lhr]*/*[tgl_lhr]*</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 156.9pt;">\r\n<p>Pekerjaan</p>\r\n</td>\r\n<td style="width: 14.15pt;">\r\n<p>:</p>\r\n</td>\r\n<td style="width: 353.05pt;">\r\n<p><span style="font-size: 10.5pt;">*[pekerjaan]*</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 156.9pt;">\r\n<p>Alamat</p>\r\n</td>\r\n<td style="width: 14.15pt;">\r\n<p>:</p>\r\n</td>\r\n<td style="width: 353.05pt;">\r\n<p><span style="font-size: 10.5pt;">*[alamat]*</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p style="text-align: justify;">Dalam hal ini bertindak untuk dan atas nama diri sendiri,selanjutnya disebut <strong>PIHAK PERTAMA</strong></p>\r\n<p style="margin-left: 36.0pt;">Nama :<strong>..............</strong></p>\r\n<p style="margin-left: 36.0pt;">No ktp :</p>\r\n<p style="margin-left: 36.0pt;">Tempat tanggal /lahir/umur :</p>\r\n<p style="margin-left: 36.0pt;">Pekerjaan :</p>\r\n<p style="margin-left: 36.0pt;">Alamat :</p>\r\n<p>Yang bertanda tangan di bawah ini :</p>\r\n<table id="tbsurat" border="0" cellspacing="0">\r\n<tb